INSERT INTO content.news VALUES ('ec5cf675-d7aa-4172-b6be-68b98c4235d6', 'Hướng dẫn sử dụng hệ thống quản lý mới', 'Hệ thống quản lý đã được cập nhật với nhiều tính năng mới.', '<p>Hệ thống quản lý đã được cập nhật với nhiều tính năng mới.</p><p>Vui lòng đọc tài liệu hướng dẫn để nắm rõ các thay đổi.</p>', 'https://example.com/images/system-guide.jpg', 'PUBLISHED', '2025-12-08 02:28:54.235443+07', NULL, 3, 234, '2025-12-08 02:28:54.235443+07', '00000000-0000-0000-0000-000000000001', '2025-12-08 02:28:54.235443+07', '00000000-0000-0000-0000-000000000001', 'INTERNAL', 'ALL', NULL);
